import{_ as e,c as t,o,ag as s}from"./chunks/framework.Ds6Eueu6.js";const R=JSON.parse('{"title":"DROP FOREIGN DATA WRAPPER","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_FOREIGN_DATA_WRAPPER.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_FOREIGN_DATA_WRAPPER.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_FOREIGN_DATA_WRAPPER.md"};function r(n,a,d,p,l,c){return o(),t("div",null,a[0]||(a[0]=[s('<h1 id="drop-foreign-data-wrapper" tabindex="-1">DROP FOREIGN DATA WRAPPER <a class="header-anchor" href="#drop-foreign-data-wrapper" aria-label="Permalink to &quot;DROP FOREIGN DATA WRAPPER&quot;">​</a></h1><p>Removes a foreign-data wrapper.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP FOREIGN DATA WRAPPER [ IF EXISTS ] &lt;name&gt; [ CASCADE | RESTRICT ]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP FOREIGN DATA WRAPPER</code> removes an existing foreign-data wrapper from the current database. A foreign-data wrapper may be removed only by its owner.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the foreign-data wrapper does not exist. WarehousePG issues a notice in this case.</p><p>name : The name of an existing foreign-data wrapper.</p><p>CASCADE : Automatically drop objects that depend on the foreign-data wrapper (such as foreign tables and servers), and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the foreign-data wrapper if any object depends on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Drop the foreign-data wrapper named <code>dbi</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP FOREIGN DATA WRAPPER dbi;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>DROP FOREIGN DATA WRAPPER</code> conforms to ISO/IEC 9075-9 (SQL/MED). The <code>IF EXISTS</code> clause is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_FOREIGN_DATA_WRAPPER.html">CREATE FOREIGN DATA WRAPPER</a>, <a href="./ALTER_FOREIGN_DATA_WRAPPER.html">ALTER FOREIGN DATA WRAPPER</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',19)]))}const A=e(i,[["render",r]]);export{R as __pageData,A as default};
